import React from 'react';

class SubmitScore extends React.Component {

  constructor(props) {
    super(props)
    state = {
      score: 0
    }
  }

  render() {
    return (
      <form>
        <input id="score-input" type="text" value={this.state.score}/>
        <input type="submit" value="Submit score" />
      </form>
    );
  }
}

export default SubmitScore;
